import React, {useState} from "react"
import './App.css';

function App() {
  const [cardNum, setCardNum] = useState(0);
  const topPane = "this is top"

  const bottomPane = "this is bottom"

  return (
    <div className="App">
      <header className="App-header splitScreen">
        <div className="splitScreen">
          <div className="topPane">{topPane}</div>
          <div className="bottomPane">{bottomPane}
            <div>You have {cardNum} cards</div>
            <button onClick={() => setCardNum(cardNum-1)}>
              Play a card!
            </button>
          </div>

        </div>
      </header>

    </div>
  );
}

export default App;
